Squaraine dyes have attracted attention for their unique properties [4–17]. A one-dimensional molecule stacking observed in squaraine solutions is of similar nature as that recognized for cyanine or merocyanine dyes. However, the dipolar polymethine dyes are built of electron-donating and electron-accepting groups connected by an (extended) π\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$$\pi$$\end{document}–electron skeleton (schematically depicted as D–π\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$$\pi$$\end{document}–A), while the squaraine dyes consist of two donating groups attached to an accepting squaric acid moiety (represented as D–A–D). Despite of all the similarities between the molecules of these two groups, the above-mentioned differences together with their implications make squaraines still intriguing and attractive subject of research. Simple notion of bond-length alternation that allows to design polymethine dyes of desired properties such as high hyperpolarizability values fail in squaraines, where the single and double bonds exhibit various lengths. Strong intramolecular charge transfer and quadrupolar character of squaraines causes that there is still no clear definition of connections between the structure and properties for these systems.

Two symmetric squaraine dyes containing nitrogen are investigated: DMASQ and DASQ (for structures and systematic name see Scheme 1). In DMASQ, nitrogen atom appears in an aniline moiety on the edge of the delocalized π\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$$\pi$$\end{document}–electron system, while in DASQ the nitrogen directly adjoins to a squaric ring. Geometry optimization of isolated molecules and aggregates was performed within the B97-D/6-311++G(d,p) approach in gas phase. Moreover, also several structures caught with the B3LYP functional are included into the investigation in order to provide for the hydrogen-bonded systems. The full optimization was performed for the aggregates containing up to four squaraine units. Due to the very complex potential energy surface, only the most prominent aggregates were investigated, since the full optimization leads to the complicated and unregular aggregates. However, in order to examine also the interactions and the cooperativity in the regular aggregates, on the basis of the fully optimized structures, the frozen-geometry models up to hexamers were also included in the current study. They serve as the base for comparison of the cooperativity for the aggregates of various nature.

