Careful analysis of the higher squaraine aggregates—trimers and tetramers—leads to the observation of some regularities (Tables 2, 3). As could be easily expected, for DMASQ molecule that does not possess the H-bond donating moieties, the H-bonded patterns do not occur readily. The obtained H-bonded structures are artificially caught in minima by using the B3LYP functional with no dispersion correction. The dispersion-corrected density functional theory always generates sandwich-like displaced structures with no H-bonds. On the other hand, for DASQ squaraine, where both proton-accepting and proton-donating moieties are present in the molecule, the H-bonded structures appear with any applied functional, also without the dispersion correction. Taking into account the sequence of dimers, trimers and tetramers for DMASQ and DASQ, the series of different interaction nature can be observed due to the structural differences of both systems. The most stable structures for DMASQ oligomers can be characterized as parallel displaced with the clenched endings. This clenching forms a closed system in which the two molecules confine the third one between them (see trimer (b) or tetramer (e)). Such a clenching in a zig-zag mode requires the relatively large mutual displacement of the molecules of about 5.5 Å—the squaric acid ring interacts with the C–N bond of the adjacent system. The interaction energy obtained for these clenched oligomers is equal to -25.98\documentclass[12pt]{minimal}
