Figure 10 and Table 4 summarize the interaction energies for the investigated oligomers up to hexamer. Left panels of Fig. 10 present the change of a total supermolecular interaction energy with chain elongation for DMASQ and DASQ, respectively, and right panels—the interaction energy per contact. Collected data suggest that the DASQ molecules behave in principle similarly for each oligomer type, and the interaction energy per contact remains constant with the chain elongation in the range from −16.4 to −19.94 kcal/mol. The situation slightly differs for DMASQ, where the interaction energy per contact significantly depends on the system type. Namely, for the hydrogen-bonded oligomers, the interaction energy per contact is the smallest and lies in the range from −10.28 to −6.02 kcal/mol, while for the remaining oligomers this energy is larger than 15 kcal/mol (and the largest for the s6 system: from −23.79 kcal/mol for the dimer to −25.14 kcal/mol for the hexamer). DMASQ s3, z3 and z6 complexes give practically identical results and their curves in Fig. 10 in principle lineup. This seems self-evident at least for s3 and z3 oligomers while analyzing the molecule placement in the chain: In both the staircase and zig-zag mode, the interaction is dominated by the interactions between the aromatic rings lying closely to each other.Fig. 10
