Summary of the interaction energy components for both fully optimized and fixed frozen DMASQ and DASQ dimers is presented in Tables 5 and 6 and in Figs. 11 and 12. As could be expected, the full optimization of the dimers leads to the strongest total interaction between molecules. Taking into account the ratio of dispersion to electrostatic contribution, which allows to classify the dimers as dispersion-bound (ratio larger than 2) or electrostatic-bound (ratio smaller than 0.5), one can observe that most of the analyzed dimers of both classes (optimized and frozen) posses the dispersion character. Clear domination of the electrostatic component can be noticed only for DASQ dimers (since DMASQ does not contain the labile protons connected to the electronegative atoms). However, it is still not significant enough to classify the (b) and (f) DASQ dimers as clearly electrostatic (dispersion to electrostatic ratio, respectively, 0.51 and 0.57). A comparison of the DMASQ and DASQ dimers leads to the conclusion that while the electrostatic contributions seem to be more pronounced for DASQ, the dispersion interaction predominates significantly in the case of DMASQ. The most stable dimer with the total SAPT0 interaction energy equal to -37.02kcal/mol\documentclass[12pt]{minimal}
				\usepackage{amsmath}
				\usepackage{wasysym}
				\usepackage{amsfonts}
				\usepackage{amssymb}
				\usepackage{amsbsy}
				\usepackage{mathrsfs}
				\usepackage{upgreek}
				\setlength{\oddsidemargin}{-69pt}
				\begin{document}$$-37.02\,\hbox {kcal/mol}$$\end{document} is depicted in Fig. 2(panel (c)) and has the dominating dispersion character arising from the parallel displaced interaction with the large displacement of about 6 Å. Among the DASQ dimers, the highest SAPT0 stability is observed for the three systems: (b), (e) and (f) panels in Fig. 3. The first and the last of them posses the strong electrostatic contribution and are bonded by the hydrogen bonds. The (e) dimer is built of the two perpendicular molecules with one of them “wrapped” about the other and is characterized by the prevailing dispersion interaction (dispersion to electrostatic ratio equal to 1.92).Table 5
