The signals do not vary much for DASQ oligomers of all the analyzed types. For each system, only one intensive signal is observed (with the oscillator strength larger than 0.5). Generally, the elongation of the oligomeric system brings about the decrease in the maximum absorption wavelength together with the increase in the intensity of the transition. In the case of the Hb-s oligomers, the corresponding wavelength decreases from 382 nm for monomer to 354 for hexamer (see Fig. 14; Table 7). The corresponding tendency for the s and z oligomers is very similar with the wavelength shifts of 28 and 15 nm for Hb-s and z oligomers, respectively. As can be noticed on Fig. 14, one should not expect a significant wavelength change with the further elongation of the oligomers in the case of the s-type systems and only small changes (probably not exceeding 5 nm) for the remaining oligomers. The exemplary molecular orbitals involved in the most intensive transitions for Hb-s DASQ monomer, dimer and hexamer are depicted in Fig. 15. One can see that the most intensive transitions for Hb-s and s oligomers involve orbitals localized in the same part of the oligomer, thus avoiding the large intermolecular charge transfer (Fig. 15).Table 7
